import React from "react";
import { useNavigate } from "react-router-dom";

export default function Dashboard() {
  const navigate = useNavigate();
  const admin = JSON.parse(localStorage.getItem("admin"));

  const handleLogout = () => {
    localStorage.removeItem("admin");
    navigate("/");
  };

  return (
    <div className="p-6 bg-gray-900 text-white max-w-lg mx-auto rounded-lg shadow-md">
      <h2 className="text-2xl font-bold mb-4">Welcome, {admin?.username}!</h2>
      <button onClick={handleLogout} className="bg-red-600 p-2 rounded hover:bg-red-700">
        Logout
      </button>
    </div>
  );
}
